//O professor está errado ao afirmar que a ordem de inserção de elementos em uma árvore AVL não altera sua estrutura final. Um contraexemplo claro  com o conjunto de elementos {30, 20, 40, 10, 25}. Se inserirmos esses valores na ordem 30, 20, 40, 10, 25, a árvore AVL resultante terá 30 como raiz, 20 como filho à esquerda e 40 à direita; o 20 terá 10 à esquerda e 25 à direita. Já se inserirmos os mesmos elementos na ordem 30, 40, 20, 10, 25, as rotações AVL ocorrera em momentos diferentes resultando assim em uma árvore com 20 como raiz, 10 à esquerda, e 30 à direita, este último terá 40 como filho direito e 25 como filho esquerdo de 40. As duas árvores possuem os mesmos elementos, mas estruturas diferentes, o que comprova que a ordem de inserção afeta sim o resultado final de uma árvore AVL.